import hero1 from "../assets/images/hero_img.png";
import image from "../assets/images/image.png";
import default_user from "../assets/images/default_user.jpg";
import addcourse from "../assets/images/addcourse.png";
const hero_images = {hero1};
const course_images = {image, addcourse};
const user_images = {default_user};
export {hero_images, course_images, user_images};
